function Home() {

    return (
            <>
            <NavBar />
            <CarrinhoContextProvider>
                <button onClick={{CarrinhoContextProvider}}>CLICAR</button>
            </CarrinhoContextProvider>
            <Container>
                <CarouselAnuncios />
                <ListaProdutos />
            </Container>

            </>    
    )
}

export { Home }
